import React, { useEffect } from "react";
import { axiosWithAuth } from "../../utils/axiosWithAuth";

const Staff = () => {
  useEffect(() => {
    axiosWithAuth()
      .get("/api/tickets")
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => console.log(err));
  }, []);
  return <div>{"Hello"}</div>;
};

export default Staff;
